import React, { Component } from 'react';
import { BrowserRouter, Route, Routes, Redirect } from 'react-router-dom';
import Login from './Login';

const Routing = () => {
    return (
        <Routes>
            <Route exact path="/" component={Login}/>
        </Routes>
    );
}

export default Routing;
